      | 367472 -> { ItemTypeData.id= 367472; name= "Militia Flaylock Pistol"; published= false; description= "The flaylock is a snub-nosed pistol designed to fire one-inch direct attack missiles. Typically, the weapon is armed with pack-loaded dumbfire or seeker missiles effective against infantry and armored targets, but is fully compatible with a broad range of missile types, making it one of the most versatile sidearm weapons on the battlefield.    Seeker missiles utilize pre-launch lock-on and rudimentary self-guidance to track designated targets, though finite propellant limits the practical engagement zone to short ranges. Although less effective against shielded targets, the tandem warhead allows penetration of armor layers before detonation, amplifying the effectiveness of the narrow fragment stream and maximizing each projectile’s lethality."; marketGroupId= None; groupId= 350858; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
