      | 4304 -> { ItemTypeData.id= 4304; name= "Research Abstract: Project Theseus"; published= true; description= "<b>Paper:</b> Project Theseus<br>  <b>Lead Researcher:</b> Valerie Valate<br>  <b>Contributors:</b> Aedeal, Horatius Caul, Calen Davrissus, Kathryn Dougans, Myyona, Katy Moore, Gosakumori Noh<br>  <b>Summary:</b> The Labyrinth deadspace complex in <a href=showinfo:5//30004124>Aphi</a> is one of the major Takmahl relic sites found in the <a href=showinfo:4//20000603>Araz constellation</a>. Project Theseus set out to map the Labyrinth, perform a survey of the site, identify any Takmahl artifacts present, and to aid in future projects investigating Takmahl culture in Araz.     Teams of ships entered the Labyrinth to combat the “Minotaur” guardians within and explore the site. The result of those efforts was a three-dimensional map which reveals much about the shape of the Labyrinth, in addition to containing useful information about the types and quantities of Takmahl artifacts to be found there.      <i>This abstract relates to research undertaken by the Arek'Jaalan Project.</i>    <i>Authorized for capsuleer dissemination under the CONCORD Freedom of Distribution Act (Alpha-One-Five), YC 113.11.4</i>    <i>Further copies of this document can be obtained through the Arek'Jaalan administrative site, located in the <a href=showinfo:5//30003413>Eram</a> system.<i>"; marketGroupId= None; groupId= 1141; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 1.000000; packagedVolume= 0.100000; portionSize= 1; radius= 1.000000; volume= 0.100000 } |> Some
