      | 49797 -> { ItemTypeData.id= 49797; name= "Sunesis Icecloud Investigators SKIN (Permanent)"; published= true; description= "The Society of Conscious Thought was among several groups that took a keen interest in the discovery of trace amounts of chromodynamic tricarboxyls in ice and vapor clouds associated with the formation of the so-called  ice dwarf  planets in certain star systems. The SoCT's investigators were apparently keen to understand the processes by which the valuable material could be extracted and refined in useful quantities from the wisps of icy vapor cloaking the icy dwarf planets.    As with much SoCT technology and associated equipment, the icecloud nanocoating was released into the hands of capsuleers, perhaps if only to see what they would do with it."; marketGroupId= Some(2314); groupId= 1950; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 49991 -> { ItemTypeData.id= 49991; name= "Stargazer Lantern Firework"; published= true; description= "Achur spiritualism takes many forms, and influences many aspects of their culture, but aside from the monastic orders of Achura (Saisio III), it rarely approaches the level of organized religion. The Stargazers are an example of a particular form of popular Achur spiritualism that eschews supernatural revelation in favor of a philosophy that aims to understand the world through observation and contemplation of the stars. Using visionary interpretations based on a kind of  as above, so below  thinking, the Stargazers emphasize awareness of the surrounding universe and understanding of the living world beyond the self.    Stargazer festivals are held wherever the viewing is good and for obvious reasons are conducted in darkness. By ancient rule, only shrouded red-light lanterns are permitted, and then only for safe movement to and from the viewing fields or vantage points. At the end of a Stargazer gathering, it is traditional to unshroud the lanterns and send them aloft by various means to symbolize the insights the Stargazers have garnered being sent out to the wider universe.    The Stargazer Lantern pyrotechnic is a spectacular means of celebrating Achur festivals, or similar celebrations among other peoples of New Eden, and is popular among those living and working in space."; marketGroupId= Some(1663); groupId= 500; dogmaAttributes= [| { DogmaAttributeValueData.attributeId = 161; value= 0.100000 }; { DogmaAttributeValueData.attributeId = 162; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 4; value= 100.000000 }; { DogmaAttributeValueData.attributeId = 37; value= 2000.000000 }; { DogmaAttributeValueData.attributeId = 70; value= 3000.000000 }; { DogmaAttributeValueData.attributeId = 422; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 9; value= 10.000000 }; { DogmaAttributeValueData.attributeId = 108; value= 35.000000 }; { DogmaAttri